{"word": "fablednow you can hardly blame a guy who lives 30 minutes south of the Seattle (insurance company name withheld) Stadium for cheerin' the Hawks...those legendary performers of almost mythological prowess...now can ya? Even if their original Kingdome was unceremoniously imploded to the taxpayer's incredulity a couple years ago. They probably did the same to Camelot after Arthur faded away ", "author": "phawgg"}
