{"word": "In all due respect Scarlett i must say that you are making a genuine attempt to straighten time frames out. My teens are amazed at the confusion in posts and the times and conflicts  There does not , as my teenage nephew indicates, appear to be an update posted before the last post is replied to, at least it appears that way as the home page does not reflect the most recent post. They participate in forums, not of this nature but they have shown them to me and they get quite a \"hoot \" out of what is going on here!!! As they have said to me, I have made errors in playing some of the games but as well it is complicated by the fact that I have posted not to the most recent post and it looks \"hilarious\"....because the most recent post at that time was not there for me to respond to.Something like what is occurring now!!I hope that in your industrious endeavours with this quality computer site that this \"glitch\" can be resolved so that members will be able to participate in a site that is a pleasant break while searching security issues or computer pogram problems at this most helpful B/C resource.  Thankyou. ", "author": "georgia"}
{"word": "georgia My last post above was just an attempt to straighten out the confusion concerning the posts in the quotes. We (phil7) and I, just happened to post at the excact same time. If you look at the post time (9:24) This can happen and can confuse things sometimes. Then members are sometimes not sure what word to reply to. Generally the one that came in first is choosen. But this is sometimes not so. Thus the confusion.  It all gets straightened out eventually. It is no big deal. As far as what is going on with you I do not understand. I see the latest post on the Home Page. Do u have (dialup)? Try refreshing the pages first. And make sure u go to the last post. Going to the last unread post is fine when u wish to be updated on the very latest info. But the last post is the better choice with the games. This may help.  If not I'm really just as confused as you. Edited by scarlett, 11 December 2004 - 08:36 AM.", "author": "Scarlett"}
